import Card from '../Card/Card';
import Resume from './resume.pdf'

const Services = () => {
  return (
    <div className="services">
        {/* left side */}
        <div className="awesome">
        <span>My Awesome</span>
        <span>Services</span>
        <span>Lorem ipsum dolor sit amet consectetur, adipisicing elit. 
            <br/>
            Exercitationem cum ad qui sed animi ratione, nesciunt repellat. 
            <br/>
            Sequi sed dolores suscipit repellendus et. Natus nesciunt quo, perferendis exercitationem fugit deserunt!
        </span>
        <a href = {Resume} download>
        <button className="button s-button">Download CV</button>
        </a>
        <div className="blur s-blur1" style = {{background:"#ABF11FF94"}}></div>
        </div>
        {/* right side */}
        <div className="cards">

            {/* first card */}
            <div style={{left: '30rem'}}>
                <Card
                emoji = {HeartEmoji}
                heading = {'Design'}
                detail = {"Figma, Sketch, Photoshop"}
                />
            </div>

            {/* Second card */}
            <div style={{top: '12rem',left: "-4rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            {/* Third card */}
            <div style={{top: '19rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>


        </div>

    </div>
  )
}

export default Services
